import React, { Component } from "react";

class PersonCard extends Component {
  render() {
    return (
      <div>
        <h1>
          {" "}
          {this.props.firstName} , {this.props.lastName}
        </h1>
        <ul>
          <li>Age :{this.props.age}</li>
          <li>Hair color :{this.props.hairColor}</li>
        </ul>
      </div>
    );
  }
}

export default PersonCard;
